`;

const OverlapGroup2 = styled.div`
  position: absolute;
  height: 52px;
  top: 0;
  left: 0;
  display: flex;
  padding: 5px 8px;
  align-items: flex-start;
  min-width: 390px;
  background-color: var(--black-2);
`;

const X3805C48449A948A3BD8A12A1C45FA08A1 = styled.img`
  width: 39px;
  height: 40px;
  object-fit: cover;
`;

const OverlapGroup = styled.div`
  width: 325px;
  height: 29px;
  position: relative;
  margin-left: 6px;
  margin-top: 2px;
`;

const CthulhuClubNFT = styled.div`
  ${MontserratBoldWhite9px}
  position: absolute;
  width: 169px;
  top: 0;
  left: 0;
  letter-spacing: 0.1px;
  line-height: 36px;
  white-space: nowrap;
`;

const Right = styled.div`
  position: absolute;
  width: 186px;
  height: 21px;
  top: 8px;
  left: 139px;
  display: flex;
  align-items: flex-start;
  overflow: hidden;
`;

const DesktopMenu = styled.div`
  width: 204px;
  position: relative;
  margin-top: -13.5px;
  display: flex;
  align-items: flex-start;
`;

const TextLink1 = styled.div`
  width: 46px;
  height: 48px;
  display: flex;
  padding: 0 10px;
  align-items: center;
  cursor: pointer;
`;

const Place = styled.div`
  ${MontserratSemiBoldWhite8px}
  min-height: 28px;
  min-width: 26px;
  text-align: center;
  letter-spacing: 0.2px;
  line-height: 28px;
  white-space: nowrap;
`;

const TextLink3 = styled.div`
  width: 40px;
  height: 48px;
  display: flex;
  padding: 0 10px;
  align-items: center;
  cursor: pointer;
`;

const Mint = styled.div`
  ${MontserratSemiBoldWhite8px}
  min-height: 28px;
  min-width: 20px;
  text-align: center;
  letter-spacing: 0.2px;
  line-height: 28px;
  white-space: nowrap;
`;

export default IPhone1313Pro1;
